import React from "react";
import assets from '../../../assets'; 

const Logo = () => (
  <svg width={94} height={89} viewBox="0 0 94 89">
    <defs>
      <style>{".a{fill:url(#a);}"}</style>
      <pattern
        id="a"
        preserveAspectRatio="xMidYMid slice"
        width="100%"
        height="100%"
        viewBox="0 0 1534 931"
      >
        <image width={1534} height={931} xlinkHref={assets.logo} /> 
      </pattern>
    </defs>
    <rect className="a" width={94} height={89} />
  </svg>
);

export default Logo;
